import React from "react";

function Home() {
  return (
    <div className="container" style={{ height: "100vh" }}>
      <div className="row justify-content-center align-items-center">
        <div className="col-6">
          <p className="display-4">
            Bringing <span>Ideas</span> To Our <span>Reality</span>
          </p>
          <span className="px-3 py-1 fs-4 rounded-2 bg-dark text-light">
            Explore
          </span>
        </div>
        <div className="col-6"></div>
      </div>
    </div>
  );
}

export default Home;
